import React from 'react';
import { BrowserRouter as Router, Route,   } from 'react-router-dom';

import './App.css';
import Welcome from './Pages/Welcome';
import Register from './Pages/Register';

function App() {
  return (
    <Router>
      <Route path="/" exact>
        <Welcome />
      </Route>
      <Route path="/Register">
        <Register />
      </Route>
    </Router>
  );
}

export default App;
